import './App.css';

// App.js


import React, { useState } from 'react';
import HomeCasual from './components/HomeCasual'; // Placeholder components
import HomeProfessional from './components/HomeProfessional'; // Placeholder components
import Navbar from './components/Navbar';  // You might have a Navbar component



function App() {
  const [desgin, setDesign] = useState('casual'); // can be either causal or professional

  return (
    <div>
    <Navbar desgin ={desgin} setDesign={setDesign} />
    {desgin === 'casual' ? <HomeCasual /> : <HomeProfessional />}
    </div>
  );
}
export default App;
